import React, { useState, useEffect } from "react";
import "./card.css";
import axios from "axios";

const Card = () => {

const [topAlbum, setTopAlbum] = useState[0];

  useEffect(() => {
    fetchTopAlbum();
  },);

  const fetchTopAlbum = async () => {
    try {
      const response = await axios.get(
        "https://qtify-backend-labs.crio.do/albums/top"
      );
      setTopAlbum(response.data);
    } catch (error) {
      console.error("Error fetching top albums:", error);
    }
  };








  return (
    <div className="grid">
      <div className="heading1">
        <div>Top Albums</div>
      </div>
      <div className="card">
        {topAlbum ? (
          topAlbum.map((album) => (
            <div key={album.id}>
              <img src={album.image} alt="cardImg" />
              <div>
                <p>{album.follows} Follows</p>
              </div>
              <p>{album.title}</p>
            </div>
          ))
        ) : (
          <p>Loading...</p>
        )}
      </div>
    </div>
  );


};

export default Card;
